// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './Diplomes.scss';

class Main extends React.Component {

  render() {
    return (
      <div className="div_diplomes">
        <Container>
          <Row>
            <Col>
              <Fade cascade>
                <h2>Diplomes</h2>
                <Card style={{ width: '18rem' }}>
                    <Card.Body>
                        <Card.Title>Baccalaureat</Card.Title>
                        <Card.Subtitle>Lycee Joliot Curie, Nanterre</Card.Subtitle>
                    </Card.Body>
                </Card>
                <Card style={{ width: '18rem' }}>
                    <Card.Body>
                        <Card.Title>Brevet des Colleges</Card.Title>
                        <Card.Subtitle>College Evarist Gallois, Nanterre</Card.Subtitle>
                    </Card.Body>
                </Card>
              </Fade>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Main;
